                        （原标题：荷兰新增1104例新冠肺炎确诊病例 累计确诊病例破万）
                    </p><p><strong style="font-family: SimSun; text-align: left; text-indent: 28px;">【海外网3月29日|战疫全时区】</strong>据<font color="#2c52b5" face="SimSun">荷兰</font>卫生部官网最新数据，过去24小时，该国新增1104例新冠肺炎确诊病例，累计确诊10866例，成为全球第11个确诊病例超过1万例的国家。新增新冠肺炎死亡病例132例，累计死亡771例。</p><p><!--EndFragment--></p><p><!--StartFragment--><!--EndFragment--></p><p><!--StartFragment--><!--EndFragment--></p><p></p>
